import Header from "../components/organism/Header";
import brandName from "../assets/logo/Logo-removebg.png";

function Error() {
    return (
        <div>
            <Header className="w-full"/>
            <div>
                <img src={brandName} alt="brandName" className="mx-auto w-45 h-auto"/>
                <h1 className="text-center text-4xl">404 - Page Not Found</h1>
            </div>
        </div>
    )
}

export default Error;
